import * as React from 'react';
import Backdrop from '@mui/material/Backdrop';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import Fade from '@mui/material/Fade';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import styled from "styled-components"
import CloseIcon from '@mui/icons-material/Close';
import CheckIcon from '@mui/icons-material/Check';

const style = {
  position: 'absolute',
  top: '50%',
    left: '50%',
    width: '90%',
    height: '90vh',
  transform: 'translate(-50%, -50%)',
  bgcolor: 'background.paper',
  boxShadow: 24,
  p: 4,
};

export default function AddUserModal({ handleOpen, open, setOpen }) {
  //const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
    <div>
      <Modal
        aria-labelledby="transition-modal-title"
        aria-describedby="transition-modal-description"
        open={open}
        onClose={handleClose}
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          timeout: 500,
        }}
      >
        <Fade in={open}>
          <Box sx={style}>
        <ModalWrap>
        <div style={{width: 30, height: 30, borderRadius: '50%', display:'flex', justifyContent:'center', alignItems:'center', border:'1px solid black', cursor:'pointer' }} onClick={handleClose}>
        <CloseIcon />
        </div>
                      </ModalWrap>
                <StepForm>
                          <div style={{ display: 'flex', justifyContent:'space-between', width: '30%', height: '100vh', padding: '0px 20px'  }}>
                              <div>
                              <Typography variant="h6" component="h6" mt={2}>Add New User</Typography>
                                  <ShortHorLine>
                                  </ShortHorLine>

                                  <StepIndicator>

                                  </StepIndicator>
                              </div>

                              <ShortVertLine>
                              </ShortVertLine>
                         </div>
                          <div style={{width: '70%', background: 'yellow', height:'100vh'}}>

                        </div>
                </StepForm>
          </Box>
        </Fade>
      </Modal>
    </div>
  );
}



const StepIndicator = styled.div`
width: 100%;
height: 
`;
const ShortHorLine = styled.div`
width: 100%;
height: 3px;
background:#1742D9;
`;

const ModalWrap = styled.div`
width: 100%;
 display:flex;
justify-content: end;
`;

const StepForm = styled.div`
width: 100%;
display:flex;
justify-content: space-around;
`;


const ShortVertLine = styled.div`
width: 1px;
height: 500px;
background:#EBEBEB;
margin-top: 100px;
`;
